import React from 'react';
import './styles/header.css';
function Header() {
    return (
        <>
             <header>
    <div class="logo">
        <img src="your-logo.png" alt="Logo" />
    </div>
    <nav>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Contact</a>
    </nav>
</header>
        </>
    )
}
export default Header;
